      className={`hamburger-wrapper ${
        isOpen ? "hamburger__open" : "hamburger__close"
      }`}
      onClick={() => setIsOpen(!isOpen)}
    >
      <div
        className={`hamburger__line ${
          isOpen ? "hamburger__lineOpen" : "hamburger__lineClose"
        }`}
      ></div>
      <div
        className={`hamburger__line ${
          isOpen ? "hamburger__lineOpen" : "hamburger__lineClose"
        }`}
      ></div>
      <div
        className={`hamburger__line ${
          isOpen ? "hamburger__lineOpen" : "hamburger__lineClose"
        }`}
      ></div>
    </div>
  );
};

export default Hamburger;
